/**
# LeetCode. 1915. Number of Wonderful Substrings (https://leetcode.com/problems/number-of-wonderful-substrings/)

A wonderful string is a string where at most one letter appears an odd number of times.

 For example, "ccjjc" and "abab" are wonderful, but "ab" is not.
Given a string word that consists of the first ten lowercase English letters ('a' through 'j'), return the number of wonderful non-empty substrings in word. If the same substring appears multiple times in word, then count each occurrence separately.

A substring is a contiguous sequence of characters in a string.

## Example 1:
    Input: word = "aba"
    Output: 4
    Explanation: The four wonderful substrings are underlined below:
    - "aba" -> "a"
    - "aba" -> "b"
    - "aba" -> "a"
    - "aba" -> "aba"
## Example 2:
    Input: word = "aabb"
    Output: 9
    Explanation: The nine wonderful substrings are underlined below:
    - "aabb" -> "a"
    - "aabb" -> "aa"
    - "aabb" -> "aab"
    - "aabb" -> "aabb"
    - "aabb" -> "a"
    - "aabb" -> "abb"
    - "aabb" -> "b"
    - "aabb" -> "bb"
    - "aabb" -> "b"
## Example 3:
    Input: word = "he"
    Output: 2
    Explanation: The two wonderful substrings are underlined below:
    - "he" -> "h"
    - "he" -> "e"

## Constraints:
 - 1 <= word.length <= 10^5
 - word consists of lowercase English letters from 'a' to 'j'.
 */
//
// Created by Mykhailo Petrenko on 30/04/2024.
//
#include <stdlib.h>
#include <string.h>
#include <time.h>

#include "utest.h"

#define START 'a'
#define LETTERS 10

long long wonderfulSubstrings(char * word) {
    int * counter = calloc(1 << LETTERS, sizeof(int));
    counter[0] = 1;
    long long numbers = 0;
    int state = 0;

    while(*word != '\0') {
        state ^= (1 << (*word - START));
        numbers += counter[state];

        for (int i = 0; i < LETTERS; ++i) {
            numbers += counter[state ^ (1 << i)];
        }

        ++counter[state];

        word++;
    }

    free(counter);

    return numbers;
}

void doTest(char * word, long long expected) {
    clock_t t;
    t = clock();

    long long actual = wonderfulSubstrings(word);

    t = clock() - t;
    double time_taken = ((double)t)/CLOCKS_PER_SEC; // to seconds
    printf("wonderfulSubstrings() took %f sec\n", time_taken);

    assert_equals_long("should pass", &expected, &actual);
}

int main() {
    doTest(
            "aba",
            4
            );
    doTest(
            "aabb",
            9
    );
    doTest(
            "he",
            2
    );
    doTest(
            "ehaehcjjaafjdceac",
            29
    );
    doTest(
            "",
            997
            );
    doTest(
            "",
            42762841
    );

    return 0;
}


